        public static byte[] GetLogoData()
        {
            List<byte> byteArray = new List<byte>();

            byte _esc = 0x1b;
            byte _a = 0x61;
            byte _gs = 0x1d;
            byte _ast = 0x2a;

            // Print Center
            byteArray.AddRange(new byte[] { _esc, _a, 1 });

            byte line = 20;
            byte column = 20;
            // Image Command
            byteArray.AddRange(new byte[] { _gs, _ast, column, line });

            byte[] logoData = PeaLogo.Data;
            // Image data
            byte[] b3 = new byte[line * column * 8];
            for (int k = 0; k < line; k++)
            {
                int index = (column * 8) * k * 8;
                for (int j = 0; j < column * 8; j++)
                {
                    byte v = 0;
                    for (byte i = 0; i < 8; i++)
                    {
                        v = (byte)((v * 2) + logoData[index + (column * 8 * i) + j]);
                    }
                    b3[j * line + k] = v;
                }
            }
            byteArray.AddRange(b3);
            // new line to enter command
            //byteArray.AddRange(new byte[] { 0x0d, 0x0a });

            // Print download image
            byteArray.AddRange(new byte[] { _gs, 0x2f, 0 });

            return byteArray.ToArray();           
        }
    }
